import React, { useState } from 'react';
import {
  Checkbox,
  FormControlLabel,
  Button,
  Typography,
} from '@material-ui/core';
import { CheckCircle } from '@material-ui/icons';
import './App.css';

const generatePassword = (
  length,
  includeUppercase,
  includeLowercase,
  includeNumbers,
  includeSymbols
) => {
  const uppercaseChars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ';
  const lowercaseChars = 'abcdefghijklmnopqrstuvwxyz';
  const numberChars = '0123456789';
  const symbolChars = '!@#$%^&*()_-+=<>?/';

  let characters = '';
  if (includeUppercase) characters += uppercaseChars;
  if (includeLowercase) characters += lowercaseChars;
  if (includeNumbers) characters += numberChars;
  if (includeSymbols) characters += symbolChars;

  let password = '';
  for (let i = 0; i < length; i++) {
    const randomIndex = Math.floor(Math.random() * characters.length);
    password += characters.charAt(randomIndex);
  }

  return password;
};

const calculatePasswordStrength = (password) => {
  // Add your own password strength calculation logic here
  // This is a simple example; you may want to use external libraries for a more accurate assessment
  return password.length >= 8 ? 'strong' : 'weak';
};

const StrengthIndicator = ({ strength }) => {
  const blocks = Array.from({ length: 4 }, (_, index) => (
    <div
      key={index}
      className={`strength-block ${index < strength ? 'filled' : ''}`}
    />
  ));

  return <div className="strength-indicator">{blocks}</div>;
};

function App() {
  const [passwordLength, setPasswordLength] = useState(12);
  const [includeUppercase, setIncludeUppercase] = useState(true);
  const [includeLowercase, setIncludeLowercase] = useState(true);
  const [includeNumbers, setIncludeNumbers] = useState(true);
  const [includeSymbols, setIncludeSymbols] = useState(true);
  const [generatedPassword, setGeneratedPassword] = useState('');
  const [passwordStrength, setPasswordStrength] = useState(null);
  const [copiedToClipboard, setCopiedToClipboard] = useState(false);

  const handleGeneratePassword = () => {
    const password = generatePassword(
      passwordLength,
      includeUppercase,
      includeLowercase,
      includeNumbers,
      includeSymbols
    );
    setGeneratedPassword(password);
    setPasswordStrength(calculatePasswordStrength(password));
    setCopiedToClipboard(false); // Reset copy status when generating a new password
  };

  const handleCopyToClipboard = () => {
    navigator.clipboard.writeText(generatedPassword);
    setCopiedToClipboard(true);
  };

  return (
    <div className="app-container">
      <div className="generated-password-container">
        <Typography variant="h6" gutterBottom>
          Generated Password
        </Typography>
        {generatedPassword && (
          <div className="generated-password-box">
            <span>{generatedPassword}</span>
            <Button
              variant="outlined"
              color="primary"
              onClick={handleCopyToClipboard}
              endIcon={<CheckCircle />}
              disabled={copiedToClipboard}
            >
              {copiedToClipboard ? 'Copied!' : 'Copy to Clipboard'}
            </Button>
          </div>
        )}
      </div>

      <div className="password-settings-container">
        <Typography variant="h4" gutterBottom>
          Password Settings
        </Typography>
        <input
          type="range"
          min="1"
          max="25"
          value={passwordLength}
          onChange={(e) => setPasswordLength(parseInt(e.target.value, 10))}
        />
        <span>{passwordLength}</span>

        <div className="input-container">
          <FormControlLabel
            control={
              <Checkbox
                checked={includeUppercase}
                onChange={() => setIncludeUppercase(!includeUppercase)}
                color="secondary" // Set checkbox color to green
              />
            }
            label="Uppercase"
          />
          <FormControlLabel
            control={
              <Checkbox
                checked={includeLowercase}
                onChange={() => setIncludeLowercase(!includeLowercase)}
                color="secondary" // Set checkbox color to green
              />
            }
            label="Lowercase"
          />
          <FormControlLabel
            control={
              <Checkbox
                checked={includeNumbers}
                onChange={() => setIncludeNumbers(!includeNumbers)}
                color="secondary" // Set checkbox color to green
              />
            }
            label="Numbers"
          />
          <FormControlLabel
            control={
              <Checkbox
                checked={includeSymbols}
                onChange={() => setIncludeSymbols(!includeSymbols)}
                color="secondary" // Set checkbox color to green
              />
            }
            label="Symbols"
          />
        </div>

        <StrengthIndicator strength={passwordStrength === 'strong' ? 4 : 0} />

        <Button
          variant="contained"
          color="primary"
          onClick={handleGeneratePassword}
        >
          Generate Password
        </Button>
      </div>
    </div>
  );
}

export default App;
